public static SKS_EFT_Setup find(boolean  _forUpdate = false)
{
    SKS_EFT_Setup sks_eft_setup;

    if (_forUpdate)
    {
        sks_eft_setup.selectForUpdate(_forUpdate);
    }

    select firstonly sks_eft_setup;

    return sks_eft_setup;
}

public static boolean IsPreNoteRequiredAP()
{
