/// <summary>
/// Get Email contact purpose -7536
/// </summary>
/// <param name="_lookupCtrl">
/// FormStringControl lookup control.
/// </param>
public static client void lookupContactPurpose(FormStringControl _lookupCtrl)
{
    SysTableLookup          sysTableLookup = SysTableLookup::newParameters(tableNum(SKS_DD_ContactRolePurposeView), _lookupCtrl);
    Query                   query = new Query();
    QueryBuildDataSource    qbdsRole;

    qbdsRole = query.addDataSource(tableNum(SKS_DD_ContactRolePurposeView));
    qbdsRole.addOrderByField(fieldNum(SKS_DD_ContactRolePurposeView, Name));

    sysTableLookup.addLookupfield(fieldNum(SKS_DD_ContactRolePurposeView, Name), true);
    sysTableLookup.addLookupfield(fieldNum(SKS_DD_ContactRolePurposeView, Description));

    sysTableLookup.parmQuery(query);
    sysTableLookup.performFormLookup();
}

public static client void lookupPaymCompanyJournalName(FormControl _formControl, DataAreaId _DefaultPaymentCompany)
{
    Query                   query          = new Query();
    QueryBuildDataSource    queryBuildDataSource;
    QueryBuildRange         queryBuildRangeJournalType;

    // Create an instance of SysTableLookup where 'this'
    // is the current form control.
    SysTableLookup sysTableLookup =
                SysTableLookup::newParameters(tableNum(LedgerJournalName), _formControl);
    ;
    changecompany(_DefaultPaymentCompany ? _DefaultPaymentCompany : curExt())
    {
        // Add fields to be shown in the lookup form.
        sysTableLookup.addLookupField(fieldNum(LedgerJournalName, JournalName));
        sysTableLookup.addLookupField(fieldNum(LedgerJournalName, Name));

        // Limit and arrange the data selection.
        queryBuildDataSource = query.addDataSource(tableNum(LedgerJournalName));
        queryBuildRangeJournalType = queryBuildDataSource.addRange(
                    fieldNum(LedgerJournalName, JournalType));
        queryBuildRangeJournalType.value(enum2str(LedgerJournalType::Payment));
        queryBuildRangeJournalType = queryBuildDataSource.addRange(
                    fieldNum(LedgerJournalName, SKS_IHB_PaymentRequestJournal));
        queryBuildRangeJournalType.value(enum2str(NoYes::No));
        queryBuildRangeJournalType = queryBuildDataSource.addRange(
                    fieldNum(LedgerJournalName, DataAreaId));
        queryBuildRangeJournalType.value(_DefaultPaymentCompany);
        sysTableLookup.parmQuery(query);

        sysTableLookup.performFormLookup();
    }
}

