/// <summary>
/// Get Legal Id number based on the Legal Id type selected in EFT/Direct Debit Setup
/// </summary>
/// <param name = "_custAccount"></param>
/// <returns></returns>
public static str getCustLegalIdNumber(CustAccount _custAccount)
{
    CustTable       locCustTable;
    DirOrganization locDirOrganization;
    str             sCustLegalIdNumber = '';

    locCustTable = CustTable::find(_custAccount);

    select firstonly locDirOrganization
        where locDirOrganization.RecId == locCustTable.Party;

    switch(SKS_EFT_Setup::find().LegalId)
    {
        case SKS_EB_LegalId::GovernmentIdNumber:
            sCustLegalIdNumber = locCustTable.IdentificationNumber;
            break;
        case SKS_EB_LegalId::OrganizationNumber:
            sCustLegalIdNumber = locDirOrganization.OrgNumber;
            break;
        case SKS_EB_LegalId::TaxExemptNumber:
            sCustLegalIdNumber = locCustTable.VATNum;
            break;
        default:
            break;
    }
    return sCustLegalIdNumber;
}

